import React from "react";
import OptionsStyle from "../styles/options";

const Options = () => {
  return (
    <div style={OptionsStyle.body}>
      <div>
        <ul style={OptionsStyle.ul}>
          <li>Create Activity</li>
          <li>Edit Activity</li>
          <li>Delete Activity</li>
        </ul>
      </div>
    </div>
  );
};

export default Options;
